Prorrogar o prazo de vigencia por mais 12 (doze)
meses, a contar de 30/03/2018 a 29/03//2019, com fundamento no Art. 57, Inciso II, da Lei
n 8.666/93;

Aditar o referido contrato, visando prorrogar o prazo de vigencia contratual.;
EMBASAMENTO LEGAL: conforme Decisao no 051 do Diretor de Administracao e Financas, datada
de 19/06/2019, considerando o Parecer Normativo no 203/2016-ACJUR e na Norma Organizacional no
4.2.2-A, Item 6.1.1.2;

Prorrogacao do prazo de execucao da obra de
Reforma de Proprio desta Administracao Regional localizado a CNM 02 (Feira Central) em Ceilandia -
DF, do 4o Termo Aditivo ao Contrato no 002/2017 - RA IX, nos termos do Padrao no 14/2002;

Alterar a
vigencia do contrato, a que faz mencao o Primeiro Termo Aditivo ao contrato, o qual passa a encerrar-se
em 05DEZ2019;

Prorrogar
o prazo de vigencia do Contrato por mais 08 (Oito) meses, encerrando-se em 30AGO2020;
EMBASAMENTO LEGAL: artigo 57,  1o, Inciso II, da Lei Federal n. 8.666/1993;

Alterar o
valor contratual inicial com vistas aditar em 25% (vinte e cinco por cento) no valor de R$ 1.550.000,00
(um milhao e quinhentos e cinquenta mil reais);

O presente Termo Aditivo objetiva prorrogar o prazo de vigencia do contrato por mais 90
(noventa dias) com base nos termos do art. 57,  1o, inciso II, da lei 8.666/93, a contar do dia 07
de junho de 2019;

Prorrogar o prazo de vigencia do referido contrato;
EMBASAMENTO LEGAL: Conforme Decisao no 310 da Diretoria Colegiada da TERRACAP, em sua 3346a
Sessao, realizada em 01/07/2019, considerando o Parecer no 203/2016-ACJUR

Fica o
contrato no 006/2015 prorrogado o prazo de execucao e o prazo de vigencia por 120 dias a partir de
17/12/2019 expirando em 15/04/2020;

Ficam realinhados os precos dos materiais betuminosos do Contrato no
0038/2017, no valor de R$ 582.327,31 (quinhentos e oitenta e dois mil trezentos e vinte e sete reais e trinta
e um centavos), referente ao periodo de agosto a novembro de 2019;

Contratacao no regime de empreitada por preco unitario para a execucao das obras para construcao
e sinalizacao de ciclovia na DF-483, SRDF 483EDF0010 ao 483EDF030, no subtrecho compreendido
entre o entroncamento de acesso ao Gama e o entroncamento com a avenida alagado em Santa Maria;

Aditar valores relativos ao pagamento das parcelas do Contrato;
EMBASAMENTO LEGAL: Decisao no 601 da Diretoria Colegiada da TERRACAP em sua 3291a
Sessao realizada em 19/11/2018
